export function groupReactionsByCardKey(reactions) {
  const grouped = new Map();
  for (const reaction of reactions){
    const key = reaction.getSourceKey();
    if (!grouped.has(key)) grouped.set(key, {
      count: 1,
      reaction
    });
    else grouped.get(key).count++;
  }
  return grouped;
}
